import React from 'react';
import Nav from './Nav';
import './pruebasStyles.css'
import empleo from '../img/empleo'

const PruebasStyles = () => {

    return (
        <div className='general-content'>   
            <div className='containerCards'>
                <div className='card'>
                    <img src={empleo}/>
                    <h2>Empleo y Emprendimiento</h2>
                </div>
            </div>
        </div>
    );
};

export default PruebasStyles;
